import * as React from "react";
import { Grid, Card, CardMedia, CardContent, Typography, Container, ImageList, ImageListItem} from '@mui/material';
import './Result.css';

export const Result = () => {
    return (
        <Container maxWidth="sm">
            <Grid spacing={4}>
                <ImageList 
                    sx={{ width:500,height:450}} 
                    cols ={5}
                    rowHeight={164}               
                >
                {
                    itemData.map((item) => (
                        <ImageListItem key={item.img}>
                            <img 
                                src={`&{item.img}?w164h164fit=crop&auto=format&dpr=2`} 
                                alt={item.title} loading='lazy'
                            />
                        </ImageListItem>
                    ))
                }
                
                </ImageList>
            </Grid>
        </Container>
    )
};

const itemData = [
    {
      img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
      title: 'Breakfast',
      author: '@bkristastucchio',
      featured: true,
    },
    {
      img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
      title: 'Burger',
      author: '@rollelflex_graphy726',
    },
    {
